import logo from './logo.svg';
import './App.css';
import Header from "./component/header/Header"
import MyNavbar from './component/header/Navbar';
import CarouselComponent from './component/header/Carousel';
import ShortsCarousel from "./component/header/Teamcard";
import Fpoa from "./component/hero/Fpoa";
import Card from './component/hero/Card';




// import card1 from './asstes/images/iplslider2.jpg'




function App() {

const cards = [
  {
    image: "https://images.unsplash.com/photo-1549921296-3a6b4d4d7b9e",
    title: "Sublime: All 8 sixes hit by Shreyas Iyer",
    date: "01 Jun, 2025",
    views: "38.7k",
    duration: "03:53 mins"
  },
  {
    image: "https://images.unsplash.com/photo-1557170334-a9632e77c7cd",
    title: "6,6,6: Shreyas Iyer finishes it off in style",
    date: "01 Jun, 2025",
    views: "48k",
    duration: "02:40 mins"
  },
  {
    image: "https://images.unsplash.com/photo-1562684890-7c3a0a4e7b61",
    title: "Class! Guiding yorkers for fours, the Shreyas Iyer way",
    date: "01 Jun, 2025",
    views: "18.3k",
    duration: "01:55 mins"
  },
  {
    image: "https://images.unsplash.com/photo-1593642532973-d31b6557fa68",
    title: "On Target! Hardik Pandya’s superb direct-hit run out",
    date: "01 Jun, 2025",
    views: "17.7k",
    duration: "01:20 mins"
  }
];

  return (
    <div>
    <Header/>  
    <MyNavbar/>
    <CarouselComponent/> 
    <div className="min-h-screen bg-[#0D1126] flex items-center justify-center p-6">
      <ShortsCarousel />
    </div>
    <Fpoa/>
    {/* <Card/> */}
      <div className="page-container">
      <h2 className="section-title">Magic Moments</h2>
      <div className="card-grid">
        {cards.map((card, idx) => (
          <MomentCard key={idx} {...card} />
        ))}
      </div>
      <div className="nav-controls">
        <button className="nav-btn">See More</button>
        <button className="nav-btn">←</button>
        <button className="nav-btn">→</button>
      </div>
    </div>
    </div>
  );
}

export default App;
